import React from "react";
import TeamMember from "./TeamMember";


function Team () {
    return(
        <div className = "row">
        <TeamMember name= 'Samer' />
        <TeamMember name= 'Majid' />
        <TeamMember name= 'Saud' />
        <TeamMember name= 'Salem' />
        </div>
    ) 

}
export default Team ;
